     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        $exploded = array_reverse(explode("\n", $this->text()));

        foreach ($exploded as $item) {
            $data = explode("\t", $item);
            if (
                ! User::where('number', $data[0])->exists()
                && (! isset($data[3]) || ! $data[3] || ! User::where('email', $data[3])->exists())
            ) {
                /** @var User $user */
                isset($data[2]) && User::create([
                    'name' => $data[2],
                    'lastname' => $data[1],
                    'login' => time(),
                    'email' => $data[3] ?: null,
                    'number' => $data[0],
                    'password' => 'none',
                    'direction_id' => 1,
                    'division_id' => Division::firstOrCreate([
                        'name' => $data[4]
                    ])->id,
                    'sex' => $data[5] == 'Мужской' ? 0 : 1
                ]);
            }
        }
    }

